import { IconButton, TableCell, TableRow } from "@mui/material"
import { useDispatch, useSelector } from "react-redux"
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete'

export const DriveType = ({id, description, pricePerLiter}) => {

    // let t = useSelector(x => x.DriveTypes).find(t => t.id == id)

    // let {description, pricePerLiter} = dt

    //    DriveTypes: [{ id: 1, description: "דלק", pricePerLiter: 10 },

    // let  = props

    let dis = useDispatch()

    let edit = () => {
        alert("אני רוצה לערוך את " + description)
    }

    let remove = () => {
        // alert("אני רוצה למחוק את " + description)
        dis()
    }

    return <>
        <TableRow
            key={description}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }} >
            <TableCell component="th" scope="row" align="center" id="rows">
                {description}
            </TableCell>
            <TableCell align="center" id="rows">
                {pricePerLiter}
            </TableCell>
            <TableCell align="center" id="rows">
                <IconButton className="roundButton" onClick={() => edit()} aria-label="delete"><EditIcon /></IconButton>
            </TableCell>
            <TableCell align="center" id="rows">
                <IconButton className="roundButton" onClick={() => remove()} aria-label="delete"><DeleteIcon /></IconButton>
            </TableCell>
        </TableRow>
    </>
}
